import React from "react";

const Project = ({ project }) => {
  return (
    <article>
      {/* <span class="image">
        <img src="../img/pic01.jpg" alt="tile-background" />
      </span> */}
      <a href="http://www.google.com/" target="_blank">
        <h2>{project.title}</h2>
      </a>
      <p>{project.content}</p>
    </article>
  );
};

export default Project;
